//import {API_URL} from "../../constants";
import 'dotenv/config';

const API_URL= process.env.API_URL;
export const pokemonEndPoint = {
  getPokemons: `${API_URL}`,
  addPokemons: `${API_URL}/question/create`,
  deletePlokemons: `${API_URL}/question/deleteQuestion`,
  updatePokeons: `${API_URL}/question/updateQuestion`,
};
